import React from 'react';

const WorkoutExample = [
    {
      id: 1,
      title: 'Shoulders & Back',
      description: 'Strenghten your upper body with exercises focused on shoulders and back muscles.',
      imageUrl: '#',
      altText: 'Cardio Workout Image',
    },
    {
      id: 2,
      title: 'Legs',
      description: 'Exercises tailored to lower body to build endurance and muscle strenght in the quads, hamstrings, glutes and calves.',
      imageUrl: '#',
      altText: 'Strength Training Image',
    },
    {
        id: 3,
        title: 'Core',
        description: 'High-intensity cardio workout to boost your endurance and burn calories.',
        imageUrl: '#',
        altText: 'Cardio Workout Image',
      },
      {
        id: 4,
        title: 'Cardio',
        description: 'Build strength and muscle mass with effective resistance training exercises.',
        imageUrl: '#',
        altText: 'Strength Training Image',
      },
  ];

function Workouts() {
    return (
        <div className="workouts">
          <h1>Workout Programs</h1>
          <div className="workout-items">
            {WorkoutExample.map((workout) => (
              <div key={workout.id} className="workout-item">
                <div className="text-content">
                  <h2>{workout.title}</h2>
                  <p>{workout.description}</p>
                </div>
                <div className="">
                  <img src={workout.imageUrl} alt={workout.altText} />
                </div>
              </div>
            ))}
          </div>
        </div>
      );
    }

export default Workouts;
